import React, { useState } from 'react';
import styled, { createGlobalStyle } from "styled-components";


function Navbar() {
  const linkStyle = { padding: '3px'};

  const uStyle={marginLeft: 'auto',
    flexDirection: 'row',
    display: 'flex',
    paddingLeft: '0',
    marginBottom: '0',
    marginTop:'0',
    marginRight:'35px',
    listStyle: 'none'};

  const LiBlock= styled.div`
  list-style: none;
  display: inline-block;
    a {
      display: block;
      padding: 15px;
      text-decoration: none;
      color: #aaa;
      font-weight: 800;
      text-transform: uppercase;
      margin: 0 10px;
      transition: all 2s;
      &:after {
        text-align: left;
        content: '.';
        margin: 0;
        opacity: 0;
      }
      &:hover {
        color: #fff;
        z-index: 1;


        }}`





  return (
    <nav >
      <section
        style={{
          display: 'flex',
          fontFamily: 'helvetica',
          flexDirection: 'row',
          alignItems: 'center',
          justifyContent: 'center',
          flexWrap: 'wrap',
          marginBottom:'5px',
          backgroundColor: 'blue',

        }}
        >
          <ul style={{
                flexDirection: 'row',
                display: 'flex',
                paddingLeft: '15px',
                marginLeft: '15px',
                marginTop: '10px',
                marginBottom: '5px',
                listStyle: 'none'}}>
            <li>
              <span>MARCO TORRES</span>
            </li>
          </ul>
          <ul style={uStyle}>
          <LiBlock>
            <div style={linkStyle}>
              <a  href="/">Home</a>
            </div>
          </LiBlock>
          <LiBlock>
            <div style={linkStyle}>
              <a  href="/Dashboard">Dashboard</a>
            </div>
          </LiBlock>  
          <LiBlock>
            <div style={linkStyle}>
              <a  href="/Login">Login</a>
            </div>
          </LiBlock>  
        </ul>  
      </section>
      <hr style={{height:'3px',border:'none',color:'rgb(65, 15, 15)',backgroundColor:'rgb(65, 15, 15)',}}></hr>
    </nav>
  );
}

  export default Navbar;
